    <div className='dark container-fluid'>
       <Header/>
       <Navbar/>
       <div className='container' id='principal'>

        <div className='oscurecido'>

        {
        servicios.map(servicio => (
          <div className='rail'> 
                <div><img src={servicio.img}></img></div>
                <div><p>lorem</p></div>
          </div>
        ))
      }
        </div>

       </div>

      <Footer
        redSocial={redSocial}
      />
    </div>
  );
}

export default App;
